import React from 'react';

class PropItem extends React.Component {
    constructor(props) {
        super(props);
        this.name = props.name;
    }

    render() {
        return <td className='propItem'>
            <div className='propName'>
                {this.name}
            </div>
            <div className='propCtrl'>
                <button className='propBtn' />
                <div className='propNum'></div>
                <button className='propBtn' />
            </div>
        </td>;
    }
}

class PropTable extends React.Component {
    constructor(props) {
        super(props);
        this.items = props.items;
    }

    render() {
        let res = [];
        for (let i in this.items)
            res.append(<PropItem name={i} />);
    }
}



class Academic extends React.Component {
    constructor(props) {
        super(props);
        this.items = ['会计', '人类学', '考古学', '建筑学', '艺术史', '生物学', '密码学', '地质学', '地质学', '克苏鲁神话', '历史', '语言', '法律', '文献查阅', '医学', '神秘学', '物理学', '神学'];
    }
    render() {
        <PropTable items={this.items} />
    }
}

class Social extends React.Component {
    constructor(props) {
        super(props);
        this.items = ['察言观色', '议价', '官僚', '警方交谈', '信誉', '奉承', '审讯', '威胁', '口述采访', '安抚', '底层社会'];
    }
    render() {
        <PropTable items={this.items} />
    }
}

class Normal extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
        this.items = ['运动', '藏匿', '伪装', '驾驶', '电器维修', '爆破', '偷窃', '枪械', '急救', '逃脱', '健康', '催眠', '机械维修', '导航', '物品整备', '精神分析', '骑术', '心智', '坚毅', '搏击', '警觉', '追踪', '潜行', '近战武器'];
    }
    render() {
    }
}

export default Academic;
